import React from 'react';
import { motion } from 'framer-motion';
import { 
  FaReact, FaNodeJs, FaJs, FaPython, FaDatabase, FaAws, 
  FaDocker, FaGithub, FaHtml5, FaCss3Alt, FaBootstrap 
} from 'react-icons/fa';
import { SiTypescript, SiMongodb, SiPostgresql, SiRedis, SiKubernetes } from 'react-icons/si';

const Skills = () => {
  const skillCategories = [
    {
      title: "Frontend Development",
      skills: [
        { name: "React", icon: <FaReact />, level: 90 },
        { name: "JavaScript", icon: <FaJs />, level: 85 },
        { name: "TypeScript", icon: <SiTypescript />, level: 80 },
        { name: "HTML5", icon: <FaHtml5 />, level: 95 },
        { name: "CSS3", icon: <FaCss3Alt />, level: 90 },
        { name: "Bootstrap", icon: <FaBootstrap />, level: 85 }
      ]
    },
    {
      title: "Backend Development",
      skills: [
        { name: "Node.js", icon: <FaNodeJs />, level: 85 },
        { name: "Python", icon: <FaPython />, level: 80 },
        { name: "Express.js", icon: <FaNodeJs />, level: 85 },
        { name: "REST APIs", icon: <FaDatabase />, level: 90 },
        { name: "GraphQL", icon: <FaDatabase />, level: 75 }
      ]
    },
    {
      title: "Databases & Cloud",
      skills: [
        { name: "MongoDB", icon: <SiMongodb />, level: 85 },
        { name: "PostgreSQL", icon: <SiPostgresql />, level: 80 },
        { name: "Redis", icon: <SiRedis />, level: 75 },
        { name: "AWS", icon: <FaAws />, level: 80 },
        { name: "Docker", icon: <FaDocker />, level: 75 },
        { name: "Kubernetes", icon: <SiKubernetes />, level: 70 }
      ]
    },
    {
      title: "Tools & Others",
      skills: [
        { name: "Git", icon: <FaGithub />, level: 90 },
        { name: "CI/CD", icon: <FaGithub />, level: 80 },
        { name: "Agile", icon: <FaGithub />, level: 85 },
        { name: "Testing", icon: <FaGithub />, level: 75 }
      ]
    }
  ];

  return (
    <section id="skills" className="py-20 bg-terminal-bg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold text-terminal-text mb-4">Skills & Technologies</h2>
          <div className="w-24 h-1 bg-primary-500 mx-auto glow-effect"></div>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
          {skillCategories.map((category, categoryIndex) => (
            <motion.div
              key={categoryIndex}
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: categoryIndex * 0.2 }}
              viewport={{ once: true }}
              className="bg-terminal-bg border border-terminal-accent/20 p-8 rounded-lg shadow-lg hover:border-primary-500/50 transition-all duration-300 glow-effect"
            >
              <h3 className="text-2xl font-bold text-terminal-text mb-6">
                {category.title}
              </h3>

              <div className="space-y-6">
                {category.skills.map((skill, skillIndex) => (
                  <motion.div
                    key={skillIndex}
                    initial={{ opacity: 0, x: -20 }}
                    whileInView={{ opacity: 1, x: 0 }}
                    transition={{ duration: 0.5, delay: skillIndex * 0.1 }}
                    viewport={{ once: true }}
                  >
                    <div className="flex items-center justify-between mb-2">
                      <div className="flex items-center gap-3">
                        <div className="text-primary-500 text-xl">
                          {skill.icon}
                        </div>
                        <span className="font-medium text-terminal-text">
                          {skill.name}
                        </span>
                      </div>
                      <span className="text-sm text-terminal-text/60">
                        {skill.level}%
                      </span>
                    </div>

                    <div className="w-full bg-terminal-accent/20 rounded-full h-2">
                      <motion.div
                        initial={{ width: 0 }}
                        whileInView={{ width: `${skill.level}%` }}
                        transition={{ duration: 1, delay: skillIndex * 0.1 }}
                        viewport={{ once: true }}
                        className="bg-gradient-to-r from-primary-500 to-primary-400 h-2 rounded-full glow-effect"
                      />
                    </div>
                  </motion.div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>

        {/* Additional Skills */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.5 }}
          viewport={{ once: true }}
          className="mt-16 bg-white p-8 rounded-lg shadow-lg"
        >
          <h3 className="text-2xl font-bold text-gray-900 mb-6 text-center">
            Additional Skills
          </h3>

          <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
            {[
              "Tailwind CSS", "Material-UI", "Redux", "Context API",
              "Socket.io", "JWT", "OAuth", "Webpack",
              "Jest", "Cypress", "Postman", "Swagger",
              "Microservices", "Serverless", "GraphQL", "REST"
            ].map((skill, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.5, delay: index * 0.05 }}
                viewport={{ once: true }}
                whileHover={{ scale: 1.05 }}
                className="bg-gray-50 p-4 rounded-lg text-center hover:bg-primary-50 transition-colors duration-200"
              >
                <span className="font-medium text-gray-700">{skill}</span>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
